//ЗАМЕНА КНОПОК
function addButtons(coord = null, syscodeGeo = null, syscodeFirm = null, moveToFiji = null, moveToFijiBySyscode = null, moveToInforussia = null, moveToYouRa = null) {
    // console.log('функция замены кнопок начала работу');
    // console.log(`ссылка: ${url}`);
    // console.log(`найденные координаты: ${coord}`);
    // console.log(`найденный сискод Fiji: ${syscode}`);
    // console.log(typeof coord);
    // if (syscodeFirm == null) {
    //     objTapUser.remove(youraLink);
    // }

    if (coord) {
        objTapUser.append(fijiLink);
        var objFijiLink = document.getElementsByClassName("fiji-link")[0];
        fijiLink.innerHTML = moveToFiji;
        objFijiLink.replaceWith(fijiLink);
    } else {
        fijiSysCode.remove();
    };


    if (syscodeGeo) {
        objTapUser.append(fijiSysCode);
        var objFijiSysCode = document.getElementsByClassName("fiji-syscode")[0];
        fijiSysCode.innerHTML = moveToFijiBySyscode;
        objFijiSysCode.replaceWith(fijiSysCode);
    } else {
        fijiSysCode.remove();
    };

    
    if (syscodeFirm) {
        objTapUser.append(irLink);
        var objIrLink = document.getElementsByClassName("inforussia-link")[0];
        irLink.innerHTML = moveToInforussia;
        objIrLink.replaceWith(irLink);
    } else {
        irLink.remove();
    };


    if (syscodeFirm) {
        objTapUser.append(youraLink);
        var objYouraLink = document.getElementsByClassName("youra-link")[0];
        youraLink.innerHTML = moveToYouRa;
        objYouraLink.replaceWith(youraLink);
    } else {
        youraLink.remove();
    };

}


//РАСПОЗНАВАНИЕ ОБНОВЛЕНИЯ СТРАНИЧКИ
function hrefHandler() {
    console.log("Функция начала работу");
    this.oldhref = window.location.href;
    this.Check;

    var that = this;
    var detect = function(){
        if(that.oldhref!=window.location.href){
            that.oldhref = window.location.href;
            url = window.location.href;
            fijIR(url, oldSysCode);
            
        }
    };
    this.Check = setInterval(function(){ detect() }, 500);
}
var hrefDetection = new hrefHandler(oldSysCode);


//РАБОТА СО ССЫЛКОЙ
function fijIR() {
    var coord = url.match(coords);
    var syscodeGeo = url.match(geo);
    var syscodeFirm = url.match(firm);
    // console.log(`ссылка: ${url}`);
    // console.log(`найденные координаты: ${coord}`);
    // console.log(`найденный сискод Fiji: ${syscode}`);
    // console.log('передача переменных функции замены кнопок');
    // console.log(syscodeGeo);

    var moveToFiji = `<a href="fiji://view/lon=${coord[0]}&lat=${coord[1]}" title="Перейти в Fiji по координатам"><svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" id="body_1" width="32" height="32"><g transform="matrix(1 0 0 1 0 0)"><image  x="0" y="0" xlink:href="data:image/png;base64," preserveAspectRatio="none" width="32" height="32"/></g></svg></a>`;
    if (syscodeGeo) {
        var moveToFijiBySyscode = `<a href="fiji://editBySysCode/${syscodeGeo}" title="Перейти в Fiji по сискоду"><svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" id="body_1" width="32" height="32"><g transform="matrix(1 0 0 1 0 0)"><image  x="0" y="0" xlink:href="data:image/png;base64," preserveAspectRatio="none" width="32" height="32"/</g></svg></a>`;
    };
    if (syscodeFirm) {
        var moveToInforussia =`<a href="dgis://editcard/id=${syscodeFirm}&sV=true" title="Перейти в IR"><svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" id="body_1" width="32" height="32"><g transform="matrix(1 0 0 1 0 0)"><image  x="0" y="0" xlink:href="data:image/png;base64," preserveAspectRatio="none" width="32" height="32"/></g></svg></a>`;
        var moveToYouRa = `<a href="https://youra.2gis.ru/task/${syscodeFirm}" title="Перейти в YouRa" target="_blank"><svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" id="body_1" width="32" height="32"><g transform="matrix(1 0 0 1 0 0)"><image  x="0" y="0" xlink:href="data:image/png;base64," preserveAspectRatio="none" width="32" height="32"/></g></svg></a>`;
    };
    addButtons(coord, syscodeGeo, syscodeFirm, moveToFiji, moveToFijiBySyscode, moveToInforussia, moveToYouRa);
}







